INSERT INTO `t_ana` VALUES ('1', '吃货的思路：好吃你就多吃点，不好吃多少也要吃点。');
INSERT INTO `t_ana` VALUES ('2', '吃货的格言：今天吃喝不努力 明天努力找吃喝。');
INSERT INTO `t_ana` VALUES ('3', '吃货匹克精神：吃的更多，吃的更饱，吃的更好！');
INSERT INTO `t_ana` VALUES ('4', '吃货的座右铭：Just eat it !');
INSERT INTO `t_ana` VALUES ('5', '我敬你是条吃货！');
INSERT INTO `t_ana` VALUES ('6', '瘦子吃给胖子看，是一件很残酷的事儿。');
INSERT INTO `t_ana` VALUES ('7', '胖子吃给瘦子看，是一件很拉风的事儿。');
INSERT INTO `t_ana` VALUES ('8', '识食物者为俊杰。');
INSERT INTO `t_ana` VALUES ('9', '最让我感动的三句话：给你带好吃的，请你去吃好吃的，带你去吃好吃的。');
INSERT INTO `t_ana` VALUES ('10', '两情若是长久时，又岂在猪猪肉肉。');
